import React, {use} from "react";

export default function TextForm(props) {

  return (
    <div>
      <div className="container">
        <h1>{props.heading}</h1>
        <div class="mb-3">
          <label for="exampleFormControlTextarea1" class="form-label">
            Example textarea
          </label>
          <textarea
            class="form-control"
            id="exampleFormControlTextarea1"
            rows="3"
          ></textarea>
        </div>
      </div>
    </div>
  );
}
